enum 키워드는 여러 형태 중 하나일 수 있는 타입을 생성하도록 해줍니다. struct로서 유효한 변형 형태라면 enum에서도 유효합니다. // 웹 이벤트를 분류하는 `enum`을 만듭니다.
// 이벤트 이름과 타입 정보가 변형 형태를 명시합니다.
// 각각의 변형은 구분되며, 독립적입니다.
enum WebEvent { // enum은 `unit` 형태의 구조 일수도 있고, PageLoad, PageUnload, // 튜플 구조일 수도 있으며, KeyPress(char), Paste(String), // c-like 구조일 수도 있습니다. Click { x: i64, y: i64 },
} // 아래 함수는 `WebEvent` enum을 받은 뒤 아무 것도 반환하지 않습니다.
fn inspect(event: WebEvent) { // `match`는 C의 `switch`와 유사합니다. match event { WebEvent::PageLoad => println!("page loaded"), WebEvent::PageUnload => println!("page unloaded"), WebEvent::KeyPress(c) => println!("pressed '{}'.", c), WebEvent::Paste(s) => println!("pasted \"{}\".", s), WebEvent::Click { x, y } => { println!("clicked at x={}, y={}.", x, y); }, }
} fn main() { let pressed = WebEvent::KeyPress('x'); // `to_owned()` 메서드는 스트링 슬라이스에서 // 스스로의 `String`을 생성해냅니다. let pasted = WebEvent::Paste("my text".to_owned()); let click = WebEvent::Click { x: 20, y: 80 }; let load = WebEvent::PageLoad; let unload = WebEvent::PageUnload; inspect(pressed); inspect(pasted); inspect(click); inspect(load); inspect(unload);
}

